                          <div className="modal-footer"> 

                            <button type="button" className="btn btn-danger">CANCEL</button>
                            <button type="button" className="btn btn-secondary" data-bs-dismiss="modal">HOME</button>
                          </div>
                        </div>
                      </div>
                    </div>
         */}

    </div>
    <br/>
    <br/>
    <br/>
    </div>
    )




}
export default Applyrc;
